import React from 'react';
import {Routes, Route, NavLink} from 'react-router-dom';
function Header() {
    return(
        <header className="header"> 
            <div className="header__logo"></div>
            <Routes>
                <Route path="/">
                    <Route path="sign-in" element={<NavLink to="/sign-up" className="header__link">Зарегистрироваться</NavLink>} />
                <Route path="sign-up" element={<NavLink to="/sign-in" className="header__link">Войти</NavLink>} />
                <Route path="places" element={<div>example@mail.ru</div>} />
                </Route>

            </Routes>
        </header>
    );
}

export default Header;
